import { Component } from "react";
import {Navigate}  from 'react-router-dom'
class Login extends Component {
    
   
    
    render() { 
        navigatHome = () =>{
            return <Navigate to="/path" replace={true} />
        }
        
        return (  
            <>
            <div>login</div>
            <button onClick={this.navigatHome}>login</button>
            </>
        );
    }
}
export default Login;
